import React from 'react';
import logo from './logo.png'; // Update the path to match your logo file

const Header = () => {
  return (
    <header>
      <div className="logo">
        <img src={logo} alt="Logo" />
        <h1>Your App Name</h1>
      </div>
      <nav>
        {/* Navigation links go here */}
      </nav>
    </header>
  );
};

export default Header;
